import { TextStyle } from '@shopify/polaris';

const Index = () => (
  <div>
    <TextStyle variation="positive">
      <div style="width:100%;height:0px;position:relative;padding-bottom:56.250%;"><iframe src="https://streamable.com/e/c0mser" frameborder="0" width="100%" height="100%" allowfullscreen style="width:100%;height:100%;position:absolute;left:0px;top:0px;overflow:hidden;"></iframe></div>
    </TextStyle>
  </div>
);

export default Index;
